description:
Este é um canal para quem quer aprender sobre:
- INFORMÁTICA PARA CONCURSOS;
- LINGUANGENS DE PROGRAMAÇÃO.

Aprovações em CONCURSOS PÚBLICOS:
• 1º lugar para Analista de TI (CRFTO) - 2023;
• 2º lugar para Analista de Sistemas (FOMENTO-TO) - 2023;
• 1º lugar para Auditor de Controle Externo – TI (TCETO) - 2022;
• 3º lugar para Analista Técnico – TI (TCETO) - 2022;
• 11º lugar para Técnico em Informática (TJTO) - 2022;
• 8º lugar para Analista de TI – Desenvolvimento – Florianópolis/SC (DATAPREV) - 2016;
• 2º lugar para Professor EBTT – Informática (Geral) (IFTO) - 2015; 
• 5º lugar para Técnico em Informática (DPETO) - 2012;
• 74º lugar para Analista em TI (Quadro Geral do Estado do Tocantins) - 2012;
• 17º lugar para Técnico em Informática (Quadro Geral do Estado do Tocantins) - 2012.

Chamo-me Arnaldo Junior, sou Auditor de Controle Externo, área Tecnologia da Informação, no Tribunal de Contas do Estado do Tocantins.

Olá! Sejam bem-vindos ao canal Nostalgia Java! ☕ 

🔵 Aqui você vai encontrar:

• PACKS (PACOTES) DE JOGOS;

• LISTAS (POR GÊNERO, FRANQUIA E ETC...);

• COMPARAÇÕES GRÁFICAS ENTRE DIFERENTES VERSÕES (MAIS E MENOS COMPLETAS);

• GAMEPLAYS;

• ANÁLISES;

• APRESENTAÇÕES DE DETALHES INTERESSANTES E IMPRESSIONANTES JÁ ENCONTRADOS;

• E MUITO MAIS...

✴ Se sua vida foi marcada por um telemóvel antigo com suporte à linguagem de programação Java Micro Edition, na qual diversos jogos incríveis e divertidíssimos tomavam completamente seu tempo e te alegravam por grande parte de sua infância/adolescência... aqui, é seu lugar! ;)

